import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          My todo app
        </h1>
      </header>
      <form>
        <p>Add a new todo:</p>
        <input
          type="text"
        />
      </form>
    </div>
  );
}

export default App;
